import React, { Component } from "react";
import './Track.css'

class Track extends Component {
	
	constructor(props) {
		super();
		this.hidden = true;
	}
	
	expand(item) {
		this.hidden = false;
		console.log(item);
	}
	
	render () {
		return (
			<p style={{position: "relative", border: "solid 1px black", width: "10%", left: "5%", top: "50px" }} onMouseOver={(e, val) => { this.expand(this); }}>Song
				<div style={{display: this.hidden ? 'block' : 'none' }}>
					test
				</div>
			</p>
		);
	}
}

export default Track;
